import Card from "../common/Card";

const Grid = ({result}) => {
    console.log(result)
  return (
    <section>
        <h2>Top results from "search!!!"</h2>
        <ul id="results">
      {result.map((data, i) => (
        <li className="movie" key={i}>
          <Card data={data} />
        </li>
      ))}
      </ul>
    </section>
  );
};

export default Grid;
